import Card from "./Card";

function Tours({tours, ignoreBtnHandle}){
    return(
        <div>
            {
                tours.map( (tour) => {
                    return <Card {...tour} ignoreBtnHandle={ignoreBtnHandle}></Card>
                })
            }
        </div>
    );
}

export default Tours;
